class Solution:
    def minValidStrings(self, words: List[str], target: str) -> int:
        # Initialize a dictionary to store the prefixes of words
        prefix_count = {}
        for word in words:
            for i in range(1, len(word)+1):
                prefix = word[:i]
                prefix_count[prefix] = prefix_count.get(prefix, 0) + 1

        # Initialize a dp array to store the minimum number of valid strings needed to form target[:i]
        n = len(target)
        dp = [float('inf')] * (n+1)
        dp[0] = 0

        # Fill the dp array
        for i in range(1, n+1):
            if target[:i] in prefix_count:
                dp[i] = 1
            else:
                for j in range(i):
                    if target[j:i] in prefix_count:
                        dp[i] = min(dp[i], dp[j] + 1)

        # If it's not possible to form target, return -1
        return dp[n] if dp[n] != float('inf') else -1
